import React from "react";
import { useSelector } from "react-redux";

function Chat() {
  const user = useSelector((state) => state.gameState.username);
  return (
    <div>
      <h1>Chat</h1>
      <div>Hello ${user}</div>
    </div>
  );
}

export default Chat;
